import Home from "../frontend/pages/home/home";
import NotFound from "../frontend/pages/notFound";



const FrontendRoute = [
    {'path': '/', 'component': Home},
    {'path': '/dashboard', 'component': Dashboard},

    {'path': '*', 'component': NotFound },
];

export default FrontendRoute;
